import React, { Component } from 'react';

export default class FarmerProfile extends Component {
    constructor(props) {
        super(props)
        this.state = {
            user_id: '',
            name: '',
            country: '',
            city: '',
            state: '',
            user: '',
        }
    }

    componentDidMount(){
        const token = localStorage.usertoken
        this.setState({
            user_id: token.user_id,
            name: token.name,
            country: token.country,
            city: token.city,
            state: token.state,
            user: token.user,
          })
    }

    render() {
        return (
            <div>this is the home page </div>
        )
    }
}
